(3, 1, 1, 'Fleurs', '<p><span style=\"font-family:Arial, sans-serif, sans;font-size:13px;font-style:normal;font-weight:400;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;background-color:#ffffff;float:none;\"><span style=\"font-size:10pt;font-weight:normal;font-style:normal;\">Retrouvez toutes les fleurs de l\'horticulture ! <br />Une sélection de belles fleurs à planter dans votre jardin. </span></span></p>', 'fleurs', '', '', ''),
(4, 1, 1, 'Plantes à massif', '<p>Des petites fleurs pour faire de beaux massifs</p>', 'plantes-a-massif', '', '', ''),
(5, 1, 1, 'Plantes diverses', '<p>De belles fleurs en pots</p>', 'plantes-diverses', '', '', ''),
(6, 1, 1, 'Plants de légumes', '<p>C\'est le printemps et l\'heure de commencer son potager !<br />Tomates et salades sont déjà prêtes à être plantées.<br />Les poivrons, aubergines et curcubitacées seront prêts à partir du 15 avril.</p>', 'plants-de-legumes', '', '', ''),
(7, 1, 1, 'Tomates', '<p>Diverses variétés de tomates. Précoces, semi-précoces et \'normales\'.<br />Pour manger des tomates durant tout l\'été !</p>', 'tomates', '', '', ''),
(8, 1, 1, 'Poivrons', '<p>Pieds de poivrons</p>', 'poivrons', '', '', ''),
(9, 1, 1, 'Plantes vivaces', '<p>De belles plantes vivaces, à conserver années après années</p>', 'plantes-vivaces', '', '', ''),
(10, 1, 1, 'Géraniums', '<p>De beaux géraniums pour vos massifs et jardinières</p>', 'geraniums', '', '', ''),
(11, 1, 1, 'Zonale', '', 'zonale', '', '', ''),
(12, 1, 1, 'Lierre simple', '', 'lierre-simple', '', '', ''),
(13, 1, 1, 'Lierre double', '', 'lierre-double', '', '', ''),
(14, 1, 1, 'Aromatiques', '<p>Mettez de la saveur dans votre cuisine en ayant vos propres plantes aromatiques à portée de main</p>', 'aromatiques', '', '', ''),
